if( $#ARGV < 0 || $#ARGV > 3 )
{
    print "Need to specify between 1 and 4 texture address operations.\n";
    exit;
}

my @stages;
while( $arg = shift @ARGV )
{
    push @stages, $arg;
}
while( $#stages < 3 )
{
    push @stages, "none";
}

print "Stages to check: @stages\n";

my %permutations;
my @temp;
for( $i = 0; $i < 4; $i++ )
{
    push @temp, splice(@stages,0,1);
    for( $j = 0; $j < 3; $j++ )
    {
        push @temp, splice(@stages,0,1);
        for( $k = 0; $k < 2; $k++ )
        {
            push @temp, splice(@stages,0,1);
            for( $l = 0; $l < 1; $l++ )
            {
                push @temp, splice(@stages,0,1);
                my $string = "$temp[0].*$temp[1].*$temp[2].*$temp[3]";
                if( !exists $permutations{$string} )
                {
                    $permutations{$string} = 1;
                }
                push @stages, pop @temp;
            }
            push @stages, pop @temp;
        }
        push @stages, pop @temp;
    }
    push @stages, pop @temp;
}

# open FILE, "texconfigs.txt";
# my @configs = <FILE>;
# close FILE;

foreach $line ( @configs )
{
    foreach $perm ( keys %permutations )
    {
        if( $line =~ m/$perm/i )
        {
            print "$line\n";
        }
    }
}